                wall2 |= (long)(local_wall6) << shiftX;
                wall_reversed2 |= (long)(local_wall_reversed6) << shiftReversedX;
                seen1 |= ((long)(local_seen5) << shiftX) & rowMask;
                seen_reversed1 |= ((long)(local_seen_reversed5) << shiftReversedX) & rowMask;
                wall1 |= (long)(local_wall5) << shiftX;
